import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search bar and enter a location
    await page.waitForSelector('#locationInput');
    await page.fill('#locationInput', 'Seoul');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_location_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_location_filled.png'));

    // Set check-in and check-out dates (pick today and tomorrow)
    const today = new Date();
    const tomorrow = new Date(today);
    tomorrow.setDate(today.getDate() + 1);
    const formatDate = d => d.toISOString().split('T')[0];

    await page.fill('#checkinInput', formatDate(today));
    await page.fill('#checkoutInput', formatDate(tomorrow));
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_dates_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_dates_filled.png'));

    // Open guest selector and add 2 adults, 1 child
    await page.click('.guest-selector');
    await page.waitForSelector('#guestMenu', { state: 'visible' });

    // Add 2 adults
    for (let i = 0; i < 2; i++) {
      await page.click('xpath=//div[@id="guestMenu"]//div[contains(@class,"guest-option")][1]//button[2]');
    }
    // Add 1 child
    await page.click('xpath=//div[@id="guestMenu"]//div[contains(@class,"guest-option")][2]//button[2]');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_guests_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_guests_selected.png'));

    // Close guest menu by clicking outside
    await page.click('body', { position: { x: 0, y: 0 } });

    // Click search button
    await page.click('.search-btn');
    // Wait for listings to update (simulate loading)
    await page.waitForSelector('#listingsGrid');
    await page.waitForTimeout(1000); // Wait for filtering animation

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_search_results.png'));

    // Apply "City" filter
    await page.click('button.filter-btn[data-filter="city"]');
    await page.waitForTimeout(800);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_city_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_city_filter.png'));

    // Wait for at least one listing card and click the first listing card
    await page.waitForSelector('.listing-card');
    const firstListing = await page.$('.listing-card');
    // Extract the listing title and host before clicking
    const listingTitle = await firstListing.$eval('.listing-location', el => el.textContent.trim());
    const listingHost = await firstListing.$eval('.listing-host', el => el.textContent.trim());

    await firstListing.click();
    // Wait for modal to appear
    await page.waitForSelector('.modal-overlay', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_listing_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_listing_modal.png'));

    // Extract data from modal: title, rating, price, host name, amenities
    const modalTitle = await page.$eval('.modal-content h1', el => el.textContent.trim());
    const modalRating = await page.$eval('.modal-content .listing-rating span', el => el.textContent.trim());
    const modalPrice = await page.$eval('.modal-content .price-amount', el => el.textContent.trim());
    const modalHost = await page.$eval('.modal-content .host-section h3', el => el.textContent.replace(/^Hosted by\s*/, '').trim());
    let modalAmenities = [];
    try {
      modalAmenities = await page.$$eval('.modal-content .amenities-list .amenity-tag', els => els.map(e => e.textContent.trim()));
    } catch (e) {
      modalAmenities = [];
    }

    // Close modal
    await page.click('.modal-close');
    await page.waitForSelector('.modal-overlay', { state: 'detached' });

    // Extract all visible listing titles after filtering
    const visibleListings = await page.$$eval('.listing-card .listing-location', els => els.map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Performed Airbnb-style search, filtered by city, selected guests and dates, opened a listing modal, and extracted listing details.",
      extractedData: {
        searchedLocation: 'Seoul',
        checkin: formatDate(today),
        checkout: formatDate(tomorrow),
        guests: { adults: 2, children: 1, infants: 0 },
        appliedFilter: 'city',
        visibleListings,
        listingModal: {
          title: modalTitle,
          rating: modalRating,
          price: modalPrice,
          host: modalHost,
          amenities: modalAmenities
        }
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Initial screenshot of the loaded homepage
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search bar section using a unique label text
    await page.waitForSelector('label:text("Where")');

    // Enter a location using placeholder attribute (different selector)
    const locationInput = await page.locator('input[placeholder="Search destinations"]');
    await locationInput.fill('Seoul');
    await page.waitForTimeout(400);

    // Enter check-in and check-out dates using input[type="date"] and nth-of-type
    const dateInputs = await page.locator('input[type="date"]');
    await dateInputs.nth(0).fill('2024-09-10');
    await dateInputs.nth(1).fill('2024-09-15');
    await page.waitForTimeout(400);

    // Open guest menu by clicking the button with id guestCount (different selector)
    await page.locator('#guestCount').click();
    await page.waitForSelector('.guest-menu.active');

    // Increase adults by clicking the "+" button using aria-label and parent context
    const adultsPlusBtn = await page.locator('//span[@id="adults"]/following-sibling::button[1]');
    await adultsPlusBtn.click();
    await adultsPlusBtn.click(); // Add 2 adults
    await page.waitForTimeout(300);

    // Take screenshot after filling search form
    const step2 = path.join(screenshotsDir, 'step_2_search_filled.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Close guest menu by clicking outside (clicking on header logo)
    await page.locator('.logo').click();
    await page.waitForTimeout(200);

    // Click the search button using icon selector inside search-bar
    await page.locator('.search-bar button.search-btn').click();

    // Wait for loading state and then for listings to appear
    await page.waitForSelector('#loading', { state: 'visible' });
    await page.waitForSelector('#loading', { state: 'hidden' });
    await page.waitForSelector('.listings-grid .listing-card', { timeout: 5000 });

    // Take screenshot of search results
    const step3 = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Click filter for "City" using button text and icon (different selector)
    await page.locator('button.filter-btn:has-text("City")').click();
    await page.waitForTimeout(600);

    // Screenshot after filter applied
    const step4 = path.join(screenshotsDir, 'step_4_city_filter.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Click on the first listing card using nth-child (different selector)
    const firstListing = await page.locator('.listings-grid .listing-card').first();
    // Extract the listing title for verification
    const listingTitle = await firstListing.locator('.listing-location').textContent();
    await firstListing.click();

    // Wait for modal/dialog to appear using role and aria-labelledby
    await page.waitForSelector('.modal-content[role="dialog"]', { timeout: 5000 });
    // Wait for the modal title to be visible
    const modalTitle = await page.locator('.modal-content h1#modal-title').textContent();

    // Screenshot of the listing modal
    const step5 = path.join(screenshotsDir, 'step_5_listing_modal.png');
    await page.screenshot({ path: step5 });
    screenshots.push(step5);

    // Extract some data from the modal for verification
    const priceText = await page.locator('.modal-content .price-amount').first().textContent();
    const hostName = await page.locator('.modal-content .host-section h3').first().textContent();

    // Close the modal using the close button with aria-label
    await page.locator('.modal-close[aria-label="Close modal"]').click();
    await page.waitForSelector('.modal-content[role="dialog"]', { state: 'detached' });

    // Extract all visible listing titles after filter
    const visibleTitles = await page.$$eval('.listings-grid .listing-card .listing-location', els =>
      els.map(e => e.textContent.trim())
    );

    return {
      success: true,
      action: "Performed Airbnb-style search: filled form, filtered by City, opened a listing modal, and extracted listing data.",
      extractedData: {
        searchLocation: 'Seoul',
        searchDates: ['2024-09-10', '2024-09-15'],
        guestCount: 2,
        filter: 'City',
        firstListingTitle: listingTitle,
        modalTitle,
        modalPrice: priceText,
        modalHost: hostName,
        visibleListingTitles: visibleTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot of the landing page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search bar using a different selector (aria-label and placeholder)
    await page.waitForSelector('input[placeholder="Search destinations"]', { timeout: 5000 });

    // Type a location using a unique selector (aria-label fallback)
    const locationInput = await page.$('input[placeholder="Search destinations"]');
    await locationInput.click({ clickCount: 3 });
    await locationInput.type('Seoul');
    await page.waitForTimeout(300);

    // Select check-in and check-out using input[type="date"]:nth-of-type(1/2)
    const dateInputs = await page.$$('input[type="date"]');
    // Set check-in to 5 days from now, check-out to 8 days from now
    const today = new Date();
    const checkin = new Date(today.getTime() + 5 * 24 * 60 * 60 * 1000);
    const checkout = new Date(today.getTime() + 8 * 24 * 60 * 60 * 1000);
    const format = d => d.toISOString().split('T')[0];
    await dateInputs[0].fill(format(checkin));
    await dateInputs[1].fill(format(checkout));
    await page.waitForTimeout(200);

    // Open guest selector using button text content
    const guestBtn = await page.locator('button:has-text("Add guests")').first();
    await guestBtn.click();
    await page.waitForSelector('#guestMenu.guest-menu.active', { timeout: 2000 });

    // Increase adults to 2 using XPath for the "+" button in the Adults row
    const adultsPlusBtn = await page.locator('//div[contains(@class,"guest-option")][.//strong[text()="Adults"]]//button[contains(text(),"+")]').first();
    await adultsPlusBtn.click();
    await adultsPlusBtn.click();

    // Increase children to 1 using XPath
    const childrenPlusBtn = await page.locator('//div[contains(@class,"guest-option")][.//strong[text()="Children"]]//button[contains(text(),"+")]').first();
    await childrenPlusBtn.click();

    // Take screenshot after filling search form
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button using icon selector
    const searchBtn = await page.locator('button.search-btn i.fa-search').first();
    await searchBtn.click();
    await page.waitForTimeout(1200); // Wait for results to update

    // Wait for at least one listing card using a unique selector (class and attribute)
    await page.waitForSelector('.listing-card[data-listing-id]', { timeout: 5000 });

    // Take screenshot of the search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Click on the first listing card using nth-of-type and data attribute
    const firstListing = await page.locator('.listing-card[data-listing-id]').first();
    const listingId = await firstListing.getAttribute('data-listing-id');
    await firstListing.click();

    // Wait for the modal to appear using role=dialog
    await page.waitForSelector('.modal-content[role="dialog"]', { timeout: 4000 });

    // Take screenshot of the listing modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_listing_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_listing_modal.png'));

    // Extract key data from the modal: title, price, rating, host name
    const modal = await page.locator('.modal-content[role="dialog"]');
    const title = await modal.locator('h1').first().textContent();
    const price = await modal.locator('.price-amount').first().textContent();
    const rating = await modal.locator('.listing-rating span').first().textContent();
    const hostName = await modal.locator('.host-section h3').first().textContent();

    // Close the modal using the close button (aria-label)
    const closeBtn = await page.locator('.modal-close[aria-label="Close modal"]').first();
    await closeBtn.click();
    await page.waitForTimeout(300);

    // Favorite the same listing using the heart button (use aria-label and data-listing-id)
    const favBtn = await page.locator(`.listing-card[data-listing-id="${listingId}"] .listing-favorite`).first();
    const favActiveBefore = await favBtn.evaluate(el => el.classList.contains('active'));
    if (!favActiveBefore) {
      await favBtn.click();
      await page.waitForTimeout(400);
    }

    // Take screenshot after favoriting
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_favorited.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_favorited.png'));

    // Extract the first 3 listing titles and prices from results
    const cards = await page.$$('.listing-card[data-listing-id]');
    const extractedListings = [];
    for (let i = 0; i < Math.min(3, cards.length); i++) {
      const card = cards[i];
      const cardTitle = await card.$eval('.listing-location', el => el.textContent.trim());
      const cardPrice = await card.$eval('.listing-price .amount', el => el.textContent.trim());
      extractedListings.push({ title: cardTitle, price: cardPrice });
    }

    return {
      success: true,
      action: "Performed search for 'Seoul', set dates and guests, opened a listing modal, favorited a listing, and extracted data.",
      extractedData: {
        modal: {
          title: title?.trim(),
          price: price?.trim(),
          rating: rating?.trim(),
          hostName: hostName?.replace(/^Hosted by /, '').trim()
        },
        searchResults: extractedListings
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for video grid to load and interact with first video
    await page.waitForSelector('.video-item');
    await page.click('.video-item:first-child');

    // Wait for video player to load
    await page.waitForSelector('.video-thumbnail-large');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_video_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_video_page.png'));

    // Click play button to simulate video playback
    await page.click('.play-button-overlay');
    await page.waitForTimeout(2000); // Wait for playback simulation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_video_playing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_video_playing.png'));

    // Like the video
    await page.click('.like-btn');
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_video_liked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_video_liked.png'));

    // Navigate back to homepage using logo
    await page.click('.logo');
    await page.waitForSelector('.video-grid');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_homepage.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_homepage.png'));

    // Perform a search
    await page.fill('.search-input', 'cooking');
    await page.click('.search-btn');
    await page.waitForSelector('.search-results');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_search_results.png'));

    // Extract video information from search results
    const extractedData = await page.evaluate(() => {
      const results = [];
      document.querySelectorAll('.search-result-item').forEach((item, index) => {
        if (index < 3) { // Get first 3 results
          results.push({
            title: item.querySelector('.result-title')?.textContent,
            channel: item.querySelector('.channel-name')?.textContent,
            views: item.querySelector('.result-stats')?.textContent
          });
        }
      });
      return results;
    });

    return {
      success: true,
      action: "Successfully navigated YouTube clone, watched video, liked content, and performed search",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete YouTube navigation task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

